#include <iostream>
#include <vector>
#include <map>
#include <set>
#include <algorithm>
#include <fmt/ranges.h>
#include <chrono>

using namespace std;

class Solution {
public:
    long long unsigned modulo = pow(10, 9) + 7;
    vector<int> goodNums = vector<int>({2, 3, 5, 6, 7, 10, 11, 13, 14, 15, 
                                 17, 19, 21, 22, 23, 26, 29, 30});
    map<int, set<int>> factorSetMap = map<int, set<int>>({
            {2, {2}}, {3, {3}}, {5, {5}}, {6, {2, 3}},
            {7, {7}}, {10, {2, 5}}, {11, {11}}, {13, {13}},
            {14, {2, 7}}, {15, {3, 5}}, {17, {17}}, 
            {19, {19}}, {21, {3, 7}}, {22, {2, 11}}, {23, {23}},
            {26, {2, 13}}, {29, {29}}, {30, {2, 3, 5}}});

    int numberOfGoodSubsets(vector<int>& nums) {
        set<int> numSet;
        vector<set<int>> allGoodSubsets;
        auto numFreq = map<int, int>();
        long long res = 0;
        long long r = 1;

        countFreqAndToSet(nums, numFreq, numSet);
        allGoodSubsets = goodSubsets(numSet);
        for (auto s: allGoodSubsets) {
            for (auto i : s) {                
                r = r * numFreq[i];
                if (r > modulo)
                    r %= modulo;
            }
            res += r;
            if (res > modulo)
                res -= modulo;
            r = 1;
        }

        return (res * calModulo(numFreq[1])) % modulo;
    }


    // caculate 2^power % modulo
    long long calModulo(unsigned power) {
        if (power <= 20) {
            return (1 << power) % modulo;
        }
        return (((1 << 20) % modulo) * calModulo(power - 20)) % modulo;
    }

    // count occurrences of all the numbers
    void countFreqAndToSet(vector<int> &nums, map<int, int> &numFreq, set<int> &numSet) {
        for (auto i : nums) {
            numFreq[i] += 1;
            numSet.insert(i);
        }
    }

    // Find all of the good subsets in numSet
    vector<set<int>> goodSubsets(set<int> &numSet) {
        vector<int> nums = vector<int>();
        for (auto i : goodNums) {
            if (numSet.find(i) != numSet.end())
                nums.push_back(i);
        }
        if(nums.size() == 0)
            return {};
        else if (nums.size() == 1)
            return vector<set<int>>({{nums[0]}});
        else
            return goodSubsetsRecursive(nums, 0);
    }
    
    vector<set<int>> goodSubsetsRecursive(vector<int> &nums, int lo) {
        if (lo == nums.size() - 1) {
            return vector<set<int>>({{nums[lo]}});
        }else {
            vector<set<int>> res;
            res.push_back({nums[lo]});
            vector<set<int>> r = goodSubsetsRecursive(nums, lo + 1);
            res.insert(res.end(), r.begin(), r.end());
            for (const auto &s: r) {
                bool insertValid = true;
                for (auto i : s) {
                    if (hasCommonFactor(nums[lo], i)) {
                        insertValid = false;
                        break;
                    }
                }
                if (insertValid) {
                    res.push_back(s);
                    res[res.size() - 1].insert(nums[lo]);
                }
            }
            return res;
        }
    }
    
    bool hasCommonFactor(int a, int b) {
        for(auto i : factorSetMap[a]) {
            for (auto j: factorSetMap[b]) {
                if (i == j)
                    return true;
            }
        } 
        return false;
    }
};

